import React from 'react';
import Snackbar from '@mui/material/Snackbar';
import MuiAlert from '@mui/material/Alert';
import { useSelector } from 'react-redux';

const Alert = React.forwardRef(function Alert(props, ref) {
    return <MuiAlert elevation={6} ref={ref} variant="filled" {...props} />;
});

const {vertical, horizontal} = {
    vertical: 'bottom',
    horizontal: 'right'
}

const Message = (props) => {
    console.log(props.open.message)
  return (
      <div>
        <Snackbar open={props.open.open} autoHideDuration={6000} onClose={props.handleClose} anchorOrigin={{ vertical, horizontal}}>
            <Alert onClose={props.handleClose} severity={props.open.type} sx={{ width: '100%' }}>
                {props.open.message}
            </Alert>
        </Snackbar>
      </div>
  );
}

export default Message;
